script: |
  super -f text -I q12016.spq | sort > q12016.out

inputs:
  - name: q12016.spq
    data: |
      SELECT + col2 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE col1 * - col2 NOT BETWEEN col0 - + col2 + 83 AND NULL;
  - name: tab1

outputs:
  - name: q12016.out
    data: |
      59
      68
      96
